import React from "react";
import Layout from '../../components/Layout';
import TaskList from '../../components/taskList'

import SkillSet from './skillset';
import Whoami from './whoami';

const projectsList = [
    'Nuddles Node.js wrapper for the Foursquare API',
    'Jabbbar Python 3 wrapper for the Dribbble API',
    'Wintermute A RESTful API for browsing Cyberpunk Authors/Novels/Characters',
    'Neuromancer.vim A vim colorscheme for the console jockeys',
    'Night-City The Ansible playbook I made to provision my development boxes',
    'F-91W My photography site. Written in React.js',
    'GoCatchEmA Restful API for Browsing Pokemon Stats. Written in Go.',
];
const historyList = [
    '2016 / Present - Freelance Django Developer -SuperTesteur - Paris, France',
    '2015 - Front End Developer -Bozboz - Brighton, UK',
    '2015 - Front End Developer -Neptik - Brighton, UK',
];
const articlesList = [
    'How to setup a virtual private server from scratch 27 Aug 2018',
    'Algorithms in Python: Quick Sort 18 Dec 2017',
    'Algorithms in Python: Bubble Sort 08 Dec 2017',
    'Connect your Go app to PostgreSQL 01 Dec 2017',
    'Basic file operations in Python 28 Nov 2017',
];

const Index = () => (
    <Layout>
        <Whoami/>
        <SkillSet/>
        <TaskList listHeader="ls projects/" taskList={projectsList} />
        <TaskList listHeader="history" taskList={historyList} />
        <TaskList listHeader="ls articles/" taskList={articlesList} />
    </Layout>
);
export default Index;
